import React from 'react';
import ReactDOM ,{ render } from 'react-dom';

function App(){
  return(
    <div>
      <h1>Design WEB</h1>
      <p>Graphic and web design</p>
      <ul>
          <li>FaceBook</li>
          <li>YouTube</li>
          <li>Instagram</li>
      </ul>
  </div>
  );
}





ReactDOM.render( <App />, document.getElementById('root'));
